import * as React from 'react';
import {Button, TextField} from '@mui/material';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent'
import DialogTitle from '@mui/material/DialogTitle';
Image

export default function NewOrder({ open, handleClose }) {

    return (
        <Dialog
            open={open}
            onClose={handleClose}
            aria-labelledby="alert-dialog-title"
            aria-describedby="alert-dialog-description"
        >
            <DialogTitle id="alert-dialog-title">Place order</DialogTitle>
            <DialogContent>

                    <form>
                        <TextField id="mobileNo"  placeholder="Enter Mobile No" lable="mobile_No" fullWidth/>
                        <TextField id="productName" placeholder="Enter Product Name"  lable="product_Name" fullWidth/>
                        <TextField id="couponCode" placeholder="Enter Coupon Code"  lable="coupon_Code" fullWidth/>
                    </form>
            </DialogContent>
            <DialogActions>

                <Button autoFocus>Submit</Button>
                <Button onClick={handleClose}>cancal</Button>
            </DialogActions>
        </Dialog>

    );
}
